Wrapped up the Bassmaster Kayak Series w/ 6th place on the Susquehanna! WHAT A WEEK! It also leaped me to 4th in AOY; I didn‚Äôt go back to back but I‚Äôll take a 1st and a 4th in consecutive years in that stiff field any day! üôåüèº Congrats to @russnyders for taking the AOY & having an unreal year. üî• Also big congrats to @about_the_bronze for taking the title on the Susquehanna! üèÜ Got to share a house w/ Josh & a bunch of other great guys; it was a trip we‚Äôll never forget! Go check out his @achiganbrand smallmouth apparel brand & his @smallietalkpodcast podcast! üéôÔ∏è 

As for the fishing, I blew it on day 1 (if you can call 6th blowing it..haha) when I lost several big fish & ended in 12th place w/ 90 inches heading into day 2. Day 2 I got back at ‚Äòem pretty good (96.25) & caught so many over 18 inches that I lost count! They were munching a Z-MAN Jackhammer & modified SlingbladeZ. @jefflittlekayakfishing asked if he could film my event for @torqeedo_fishing like he has for others in the past, so you‚Äôll get to see it all from start to finish very soon. Day 1 video will be posted to his YouTube channel (The Little Stuff) on Sunday night. Subscribe so you don‚Äôt miss the notification for day 2‚Äôs video! The 1103 motor with @innovativesportsman rock guard, weed cutter and steering bracket on my @crescentkayaks Shoalie made all the difference on that river; I‚Äôve never fished so efficiently in all my life. üèÑ‚Äç‚ôÇÔ∏è

I was also taken back by how many @crescentkayaks Shoalies were at the event! Huge THANK YOU to all who believed in that boat enough to buy it. It truly has been an absolute river machine, both w/ and without the Torqeedo! ‚ò∫Ô∏è

As always thanks to @bass_nation for a great season, @steve_owens_0207 for running an awesome trail! Can‚Äôt wait for next year because the schedule doesn‚Äôt conflict w/ any of the @kayakadventureseries events! üëç

